import React from "react";

function Profile() {
  return (
    <div style={styles.container}>
      <h2>Profile Page</h2>
      <p>This is where user profile details will be displayed.</p>
    </div>
  );
}

const styles = {
  container: {
    padding: "20px",
    fontFamily: "Arial, sans-serif",
  },
};

export default Profile;
